    import React, { useState } from 'react';
    import axios from 'axios';
    import { useNavigate } from 'react-router-dom';

    const AddBooking = () => {
    const navigate = useNavigate();
    const House_API1 = 'http://26.90.237.200:3000/user/add';
    const House_API2 = 'http://26.90.237.200:3000/book/add';

    const [id, setId] = useState('');
    const [addName, setAddName] = useState('');
    const [addLastname, setAddLastname] = useState('');
    const [addAddress, setAddAddress] = useState('');
    const [addAge, setAddAge] = useState('');
    const [addPhone, setAddPhone] = useState('');

    const [addAmount, setAddAmount] = useState('');
    const [addHouseFK, setAddHouseFK] = useState('');
    //   const [addUserFK, setAddUserFK] = useState('');
    const addUser = async () => {
        const data1 = {
        id: id,
        addName: addName,
        addLastname: addLastname,
        addAddress: addAddress,
        addAge: addAge,
        addPhone: addPhone,
        };
console.log(data1)
        const data2 = {
        addAmount: addAmount,
        addHouseFK: addHouseFK,
        addUserFK:  id, // ใช้ค่า id จาก state ของข้อมูลลูกค้า
        };
console.log(data2)
        try {
        const response1 = await axios.post(House_API1, data1);
        console.log(response1.data);

        const response2 = await axios.post(House_API2, data2,
          );
        console.log(response2.data);

        alert('ทำการจองสำเร็จแล้ว');
        navigate('/Booking');
        } catch (error) {
        console.error(error);
        }
    };

    return (
        <div className="container">
            
        <form className='card'>
            <div className="mb-3">
                <br/>
            <div className=" container">
            <br/>
                <h4>ข้อมูลลูกค้า</h4>
                <br/>
            <div>
                <label htmlFor="id" className="form-label">
                เลขบัตรประชาชน
                </label>
                <input
                type="text"
                className="form-control"
                id="id"
                value={id}
                onChange={(e) => setId(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="addName" className="form-label">
                ชื่อ
                </label>
                <input
                type="text"
                className="form-control"
                id="addName"
                value={addName}
                onChange={(e) => setAddName(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="addLastname" className="form-label">
                นามสกุล
                </label>
                <input
                type="text"
                className="form-control"
                id="addLastname"
                value={addLastname}
                onChange={(e) => setAddLastname(e.target.value)}
                />
            </div>
            <div >
                <label htmlFor="addAddress" className="form-label">
                ที่อยู่
                </label>
                <input
                type="text"
                className="form-control"
                id="addAddress"
                value={addAddress}
                onChange={(e) => setAddAddress(e.target.value)}
                />
            </div>
            
            <div>
                <label htmlFor="addAge" className="form-label">
                อายุ
                </label>
                <input
                type="text"
                className="form-control"
                id="addAge"
                value={addAge}
                onChange={(e) => setAddAge(e.target.value)}
                />
            </div>

            <div>
                <label htmlFor="addPhone" className="form-label">
                เบอร์โทร
                </label>
                <input
                type="text"
                className="form-control"
                id="addPhone"
                value={addPhone}
                onChange={(e) => setAddPhone(e.target.value)}
                />
            </div>
            
            </div>
            </div>

            <div className="card" >
            <br/>
                <h4>ข้อมูลบ้านที่จอง</h4>
                <br/>
            <div className="form-group ">
            <label>ราคาจอง</label>
            <input
                type="text"
                className="form-control"
                value={addAmount}
                onChange={(e) => setAddAmount(e.target.value)}
            />
            </div>
            <div className="form-group">
            <label>บ้านเลขที่</label>
            <input
                type="text"
                className="form-control"
                value={addHouseFK}
                onChange={(e) => setAddHouseFK(e.target.value)}
            />
            </div>
            {/* <div className="form-group">
            <label>เลขบัตรประชาชน</label>
            <input
                type="text"
                className="form-control"
                value={addUserFK}
                onChange={(e) => setAddUserFK(e.target.value)}
            />
            </div> */}
            </div>
    <br/>
            <button type="button" className="btn btn-primary" onClick={addUser}>
            จอง
            </button>
        </form>
        </div>
    );
    };

    export default AddBooking;
